import React from "react";
import "./PersonCard.scss";

const PersonCard = props => {
  return (
    <div className="container">
      <div className="left-side">
        <div className="logo">
          <img alt="logo.jpg" src={props.logo} />
        </div>
        <div className="bio" style={props.style}>
          "{props.bio}"
        </div>
        <div className="twitter-handles">
          <a href="https://twitter.com/BarrenSkills" target="_blank">
            @BarrenSkills
          </a>
          <a href="https://twitter.com/barrenschools" target="_blank">
            @barrenschools
          </a>
          <a href="https://twitter.com/BarrenZone" target="_blank">
            @BarrenZone
          </a>
          <a href="https://twitter.com/Interapt" target="_blank">
            @Interapt
          </a>
        </div>
      </div>
      <div className="right-side">
        <div className="bio-pic">
          <img alt="bio-pic.jpg" src={props.pic} />
        </div>
        <div className="name-age">
          {props.firstname}
          <span> {props.lastname}</span>, {props.age}
        </div>
        <div className="location">
          {props.county}, <span className="state">{props.statename}</span>
        </div>
        <div className="time">{props.time}</div>
      </div>
    </div>
  );
};

export default PersonCard;
